import React, { useState, useEffect } from 'react';
import axios from 'axios';

interface StaffMember {
  staff_id: string;
  name: string;
  email: string;
}

interface Subscription {
  subscription_id: number;
  plan_type: 'basic' | 'standard' | 'partner';
  monthly_charges: number;
  total_charges: number;
  plan_duration: number;
  monthly_rate: number;
  total_charge: number;
  max_staff_allowed: number;
  start_date: string;
  end_date: string;
  active: boolean;
}

interface CompanyProfile {
  client_info: {
    company_id: number;
    company_name: string;
    company_email: string;
    company_address: string;
    company_contact_no: string;
  };
  staff_members: StaffMember[];
  subscriptions: Subscription[];
}

const CompanyDashboard: React.FC = () => {
  const [staffId, setStaffId] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [password2, setPassword2] = useState('');
  const [error, setError] = useState<string | null>(null);
  const [success, setSuccess] = useState<string | null>(null);
  const [loading, setLoading] = useState(false);
  const [profile, setProfile] = useState<CompanyProfile | null>(null);
  const [profileLoading, setProfileLoading] = useState(true);
  const [profileError, setProfileError] = useState<string | null>(null);

  useEffect(() => {
    fetchCompanyProfile();
  }, []);

  const fetchCompanyProfile = async () => {
    try {
      const token = localStorage.getItem('authToken');
      if (!token) {
        setProfileError('Authentication required');
        return;
      }

      const response = await axios.get('http://127.0.0.1:8000/api/client/profile/', {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      setProfile(response.data);
    } catch (err) {
      setProfileError('Failed to load company profile');
      console.error('Profile fetch error:', err);
    } finally {
      setProfileLoading(false);
    }
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);
    setSuccess(null);
    setLoading(true);
    try {
      const token = localStorage.getItem('authToken');
      if (!token) {
        setError('You must be logged in as a company to register staff.');
        setLoading(false);
        return;
      }

      // Check if adding new staff would exceed plan limit
      if (profile?.subscriptions[0]) {
        const currentStaff = profile.staff_members.length;
        const maxAllowed = profile.subscriptions[0].max_staff_allowed;
        if (maxAllowed !== null && currentStaff >= maxAllowed) {
          setError(`Cannot add more staff. Your ${profile.subscriptions[0].plan_type} plan allows maximum ${maxAllowed} staff members.`);
          setLoading(false);
          return;
        }
      }

      const response = await axios.post(
        'http://127.0.0.1:8000/api/client/add-staff/',
        {
          staff_id: staffId,
          name,
          email,
          password,
          password2,
        },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setSuccess('Staff registered successfully!');
      setStaffId('');
      setName('');
      setEmail('');
      setPassword('');
      setPassword2('');
      // Refresh profile to show new staff member
      fetchCompanyProfile();
    } catch (err: any) {
      if (axios.isAxiosError(err) && err.response) {
        setError(err.response.data.detail || 'Failed to register staff member');
      } else {
        setError('An unexpected error occurred');
      }
    } finally {
      setLoading(false);
    }
  };

  if (profileLoading) {
    return (
      <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
        <div className="relative py-3 sm:max-w-xl sm:mx-auto">
          <div className="text-center">Loading company profile...</div>
        </div>
      </div>
    );
  }

  if (profileError) {
    return (
      <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
        <div className="relative py-3 sm:max-w-xl sm:mx-auto">
          <div className="text-red-600">{profileError}</div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-100 py-6 flex flex-col justify-center sm:py-12">
      <div className="relative py-3 sm:max-w-xl sm:mx-auto">
        <div className="relative px-4 py-10 bg-white mx-8 md:mx-0 shadow rounded-3xl sm:p-10">
          {/* Company Profile Section */}
          {profile && (
            <div className="mb-8">
              <h2 className="text-2xl font-bold mb-4">Company Profile</h2>
              <div className="grid grid-cols-2 gap-4 mb-6">
                <div>
                  <p className="text-gray-600">Company Name</p>
                  <p className="font-semibold">{profile.client_info.company_name}</p>
                </div>
                <div>
                  <p className="text-gray-600">Company ID</p>
                  <p className="font-semibold">{profile.client_info.company_id}</p>
                </div>
                <div>
                  <p className="text-gray-600">Email</p>
                  <p className="font-semibold">{profile.client_info.company_email}</p>
                </div>
                <div>
                  <p className="text-gray-600">Contact</p>
                  <p className="font-semibold">{profile.client_info.company_contact_no}</p>
                </div>
                <div className="col-span-2">
                  <p className="text-gray-600">Address</p>
                  <p className="font-semibold">{profile.client_info.company_address}</p>
                </div>
              </div>

              {/* Subscription Details */}
              {profile.subscriptions[0] && (
                <div className="mb-6">
                  <h3 className="text-xl font-semibold mb-3">Subscription Details</h3>
                  <div className="bg-indigo-50 p-4 rounded-lg">
                    <div className="grid grid-cols-2 gap-4">
                      <div>
                        <p className="text-gray-600">Plan Type</p>
                        <p className="font-semibold capitalize">{profile.subscriptions[0].plan_type}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">Status</p>
                        <p className="font-semibold">{profile.subscriptions[0].active ? 'Active' : 'Inactive'}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">Monthly Rate</p>
                        <p className="font-semibold">${profile.subscriptions[0].monthly_rate}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">Total Charges</p>
                        <p className="font-semibold">${profile.subscriptions[0].total_charge}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">Start Date</p>
                        <p className="font-semibold">{new Date(profile.subscriptions[0].start_date).toLocaleDateString()}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">End Date</p>
                        <p className="font-semibold">{new Date(profile.subscriptions[0].end_date).toLocaleDateString()}</p>
                      </div>
                      <div>
                        <p className="text-gray-600">Staff Limit</p>
                        <p className="font-semibold">
                          {profile.subscriptions[0].max_staff_allowed === null 
                            ? 'Unlimited' 
                            : profile.subscriptions[0].max_staff_allowed}
                        </p>
                      </div>
                    </div>
                  </div>
                </div>
              )}

              {/* Staff List */}
              <div className="mb-6">
                <h3 className="text-xl font-semibold mb-3">Staff Members ({profile.staff_members.length})</h3>
                <div className="bg-gray-50 rounded-lg overflow-hidden">
                  <table className="min-w-full divide-y divide-gray-200">
                    <thead className="bg-gray-50">
                      <tr>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Staff ID</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Name</th>
                        <th className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Email</th>
                      </tr>
                    </thead>
                    <tbody className="bg-white divide-y divide-gray-200">
                      {profile.staff_members.map((staff) => (
                        <tr key={staff.staff_id}>
                          <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{staff.staff_id}</td>
                          <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{staff.name}</td>
                          <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-900">{staff.email}</td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
          )}

          {/* Add Staff Form */}
          <div className="mt-8">
            <h2 className="text-2xl font-bold mb-4">Add New Staff Member</h2>
            {error && <div className="mb-4 text-red-600">{error}</div>}
            {success && <div className="mb-4 text-green-600">{success}</div>}
            <form onSubmit={handleSubmit} className="space-y-4">
              <div>
                <label htmlFor="staff-id" className="block text-sm font-medium text-gray-700">
                  Staff ID
                </label>
                <input
                  type="text"
                  id="staff-id"
                  value={staffId}
                  onChange={(e) => setStaffId(e.target.value)}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  required
                  disabled={loading}
                />
              </div>
              <div>
                <label htmlFor="name" className="block text-sm font-medium text-gray-700">
                  Name
                </label>
                <input
                  type="text"
                  id="name"
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  required
                  disabled={loading}
                />
              </div>
              <div>
                <label htmlFor="email" className="block text-sm font-medium text-gray-700">
                  Email
                </label>
                <input
                  type="email"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  required
                  disabled={loading}
                />
              </div>
              <div>
                <label htmlFor="password" className="block text-sm font-medium text-gray-700">
                  Password
                </label>
                <input
                  type="password"
                  id="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  required
                  disabled={loading}
                />
              </div>
              <div>
                <label htmlFor="password2" className="block text-sm font-medium text-gray-700">
                  Confirm Password
                </label>
                <input
                  type="password"
                  id="password2"
                  value={password2}
                  onChange={(e) => setPassword2(e.target.value)}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500 sm:text-sm"
                  required
                  disabled={loading}
                />
              </div>
              <div>
                <button
                  type="submit"
                  disabled={loading}
                  className="w-full flex justify-center py-2 px-4 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 disabled:opacity-50"
                >
                  {loading ? 'Adding Staff...' : 'Add Staff Member'}
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CompanyDashboard;
